export function worksContentDataSuccess(works) {
    return {
        type: "WORKS_CONTENT_DATA_SUCCESS",
        works
    }
}

export const worksContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(works => dispatch(worksContentDataSuccess(works)))
}
export const getMoreWorks=(url,start,end)=> dispatch =>{
   // e.preventDefault;
    console.log(start)
    var formData=new FormData();
    formData.append("Start", start);
    formData.append("End", end);
    fetch(url,{
        method:'post',
        body: formData
    }).then(
        response => {
            if (!response.ok) {
                throw new Error(response.statusText)
            }
            return response
        })
        .then(response => response.json())
        .then(works => dispatch(worksContentDataSuccess(works)))
}
